import React from 'react'
import './BookmarkCard.css'

class BookmarkCard extends React.Component {
    render () {
        return (
            <div role="link" href="foo" target="_blank" className="BookmarkCard">
                Iam BookmarkCard
            </div>
        )
    }
}

export default BookmarkCard
